import React, { useEffect, useState } from 'react';

import './App.css';

import scale from './assets/radaltback.png';
import cover from './assets/radaltcover.png';
import needle from './assets/radaltneedle.png';
import bugImg from './assets/bug.png';
import flagImg from './assets/radaltflag.png';


function AltitudeNeedle(){
  let [currentAlt,newAlt] = useState(0);


  return(
  <div className='altitude'>
    <img className='radalneedle' src={needle} />
    <h4>Altitude: </h4>
    <input type="range" className="needle-range" min="0" max="1500" onChange={(event) => newAlt(event.target.value)} />    
    <h4>{currentAlt}</h4>
  </div>);
}

function AltitudeBug(){
  let [currentbugAlt,newbugAlt] = useState(0);


  return(
  <div className='bug'>
  <img className='bug-ponter' src={bugImg} />
  <h4>Bug: </h4>
  <input type="range" className="bug-range" min="0" max="1500" 
  onChange={(event) => newbugAlt(event.target.value)} />
 <h4>{currentbugAlt}</h4>
</div>);

}
function toggle(value){
  return !value;
}

function HaspowerLight(){
  const [checked, setChecked] = useState(false);

  return( 
  <div className='haspower'>
    <h4>Has power</h4>
    <input type='checkbox' checked={checked} onChange={() => setChecked(toggle)}></input>
  </div>);
}





function App() { 




  return(
    <div>      
      <div className='core'>
        <div className='title'>
          <h1>Radar Altimeter</h1>
        </div>
        <div className='radalt-image'>          
          <img className='radaltback' src={scale} />
          <img className='radaltcover' src={cover} />          
          <img className='radaltflag' src={flagImg} />       
        </div>              
      </div>
      <div className='range-input'>
        <AltitudeNeedle/>
        <AltitudeBug/>
        <HaspowerLight/>        
      </div>

    </div>
  );
}



export default App;
